import{_ as e,o as t,c as o,Q as c}from"./chunks/framework.7c0fadea.js";const h=JSON.parse('{"title":"开启写作之旅","description":"","frontmatter":{},"headers":[],"relativePath":"articles/index.md","filePath":"articles/index.md","lastUpdated":1670330848000}'),p={name:"articles/index.md"},a=c('<h1 id="开启写作之旅" tabindex="-1">开启写作之旅 <a class="header-anchor" href="#开启写作之旅" aria-label="Permalink to &quot;开启写作之旅&quot;">​</a></h1><div class="tip custom-block"><p class="custom-block-title">文章</p><p>这里将开始自己的写作之旅（不仅仅是技术）</p></div><p><strong>简介</strong></p><p>我是一名<code>前端开发者</code>，2018 毕业，目前在杭州就业。</p><p>2018 年初，迈出校门，走入社会。</p><p>大学所学的知识让我充满了迷茫与惆怅（计算机专业什么都学），不知道出去该往哪个方向发展，路途未知。</p><p><code>第一份工作</code></p><p>靠着校招拿到一个 offer，沾沾自喜的我开始了第一份自己的工作。靠着自己的一分热血， 总以为能得到满意的结果。可事实终究残酷无情。学校中身边的都是你的同龄人，社会中面对着不同的层次，你所想的永远是太天真。</p><p>总结一句话：<code>不要害怕经历，经历多一点你以后的路就好走一点</code>。</p><p><code>第二份工作进行中</code></p><p>～ ～ ～</p><p><code>目标展望</code></p><p>往后的路还长，技术之路也还很漫长，慢慢积累自己的经历。</p><p>路从现在开始，走下去，努力下去，成熟下去，向着自己的目标进发。</p><div class="danger custom-block"><p class="custom-block-title">寄语</p><p>一步一个脚印，你以后得到的，就是你现在付出的！</p></div>',15),s=[a];function d(i,r,n,l,_,m){return t(),o("div",null,s)}const u=e(p,[["render",d]]);export{h as __pageData,u as default};
